import Link from 'next/link';
import { css, jsx } from "@emotion/core";
import styled from "@emotion/styled"

const Container = styled.div`
  display: block;
  
  position: fixed;
  padding: 15px 10px;
  margin: 0px;
  top: 0px;
  left: 0px;
  right: 0px;

  background-color: gray;
  border: solid;

  a{
    
  }
`;//margin: 15px;

const MemberWrapper = styled.div`
  display: flex;
  justify-content: flex-end;
  
  border: solid;
  margin: 15px;
`;//float: right;

const MenuWrapper = styled.span`
 

  margin: 15px;

  .rank{
  
  }

  border: solid;
`;//float: left;  .menu{  }// display: flex;


const Menu = styled.span`
  display: inline-flex;
  justify-content: flex-start;
  
`;//float: left;

const Rank = styled.span`
  display: inline-flex;
  justify-content: flex-end;
  
`;//float: right;


const Header = () => (
  <Container>
    <MemberWrapper>
      <Link href="/">
      <a className='membership'>로그인</a>
      </Link>
      <Link href="/">
        <a className='membership'>회원가입</a>
      </Link>
    </MemberWrapper>


    <MenuWrapper>
    <Menu>
      <Link href="/">
        <a className='menu' id='logo'>로고 OR 웹사이트명</a>
      </Link>
    </Menu>

    <Rank>
      <Link href="/">
        <a className='menu'>사이트 소개</a>
      </Link>
      <Link href="/">
        <a className='menu'>나의 사이트</a>
      </Link>
      <a className='rank'>1. 더블슬래시</a>
      <a className='rank' id='button'>ㅁ</a>
    </Rank>
    </MenuWrapper>
  </Container>
);

export default Header;
